import React, { Component } from 'react';
import GameContext from '../contexts/gameContext';
import { useContext } from 'react';

function EinloggenButton() {
    
    const { gameInfo, setGameInfo } = useContext(GameContext);
    
    

    return (
        <div className='containerhome'>
            <button onClick={() => {
                let newGameInfo = {...gameInfo}; // Erstellen Sie eine Kopie von gameInfo
                if (!newGameInfo.hasOwnProperty('newParam')) { // Prüfen Sie, ob der neue Parameter bereits existiert
                    newGameInfo.newParam = 'newValue'; // Fügen Sie den neuen Parameter hinzu, wenn er noch nicht existiert
                }
                setGameInfo(newGameInfo); // Aktualisieren Sie gameInfo mit dem neuen Objekt
                console.log("gameInfoButton: " + gameInfo[0]);
            }} type="button" class="btn btn-primary" id='einloggenbutton'>Einloggen</button>
        </div>
    );
}

export default EinloggenButton;
